#!/api/JW.Class' rel='JW.Class' class='docClass'>JW.Class</a><div class='subclass '><a href='#!/api/JW.AbstractCollection' rel='JW.AbstractCollection' class='docClass'>JW.AbstractCollection</a><div class='subclass '><a href='#!/api/JW.AbstractSet' rel='JW.AbstractSet' class='docClass'>JW.AbstractSet</a><div class='subclass '><strong>JW.ObservableSet</strong></div></div></div></div><h4>Files</h4><div class='dependency'><a href='source/observableSet.html#JW-ObservableSet' target='_blank'>observableSet.js</a></div></pre><div class='doc-contents'><p><code>&lt;T extends <a href=\"#!/api/JW.Class\" rel=\"JW.Class\" class=\"docClass\">JW.Class</a>&gt; extends <a href=\"#!/api/JW.AbstractSet\" rel=\"JW.AbstractSet\" class=\"docClass\">JW.AbstractSet</a>&lt;T&gt;</code></p>\n\n<p>Has several events and an observable property <a href=\"#!/api/JW.ObservableSet-property-length\" rel=\"JW.ObservableSet-property-length\" class=\"docClass\">length</a>.</p>\n\n<p>See structurized list of methods in <a href=\"#!/api/JW.AbstractSet\" rel=\"JW.AbstractSet\" class=\"docClass\">JW.AbstractSet</a>.</p>\n</div><div class='members'><div class='members-section'><div class='definedBy'>Defined By</div><h3 class='members-title icon-property'>Properties</h3><div class='subsection'><div id='property-_iid' class='member first-child inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/JW.Class' rel='JW.Class' class='defined-in docClass'>JW.Class</a><br/><a href='source/class.html#JW-Class-property-_iid' target='_blank' class='view-source'>view source</a></div><a href='#!/api/JW.Class-property-_iid' class='name expandable'>_iid</a> : number<span class=\"signature\"></span></div><div class='description'><div class='short'>Instance ID. ...</div><div class='long'><p>Instance ID.</p>\n\n<p>Auto-incremental object unique ID. Each <a href=\"#!/api/JW.Class\" rel=\"JW.Class\" class=\"docClass\">JW.Class</a> instance gets such identifier.\nUsed in <a href=\"#!/api/JW.AbstractSet\" rel=\"JW.AbstractSet\" class=\"docClass\">JW.AbstractSet</a> as map key for quick item access.</p>\n</div></div></div><div id='property-constructor' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/JW.Class' rel='JW.Class' class='defined-in docClass'>JW.Class</a><br/><a href='source/class.html#JW-Class-property-constructor' target='_blank' class='view-source'>view source</a></div><a href='#!/api/JW.Class-property-constructor' class='name expandable'>constructor</a> : Function<span class=\"signature\"></span></div><div class='description'><div class='short'>Constructor as class. ...</div><div class='long'><p>Constructor as class. If you have an object, you can get its class using this field.</p>\n</div></div></div><div id='property-length' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='JW.ObservableSet'>JW.ObservableSet</span><br/><a href='source/observableSet.html#JW-ObservableSet-property-length' target='_blank' class='view-source'>view source</a></div><a href='#!/api/JW.ObservableSet-property-length' class='name expandable'>length</a> : <a href=\"#!/api/JW.Property\" rel=\"JW.Property\" class=\"docClass\">JW.Property</a><span class=\"signature\"></span></div><div class='description'><div class='short'>&lt;Number&gt; Collection length. ...</div><div class='long'><p><code>&lt;Number&gt;</code> Collection length. <strong>Don't modify manually!</strong></p>\n</div></div></div></div></div><div class='members-section'><div class='definedBy'>Defined By</div><h3 class='members-title icon-method'>Methods</h3><div class='subsection'><div id='method-constructor' class='member first-child not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='JW.ObservableSet'>JW.ObservableSet</span><br/><a href='source/observableSet.html#JW-ObservableSet-method-constructor' target='_blank' class='view-source'>view source</a></div><strong class='new-keyword'>new</strong><a href='#!/api/JW.ObservableSet-method-constructor' class='name expandable'>JW.ObservableSet</a>( <span class='pre'>[items], [adapter]</span> ) : <a href=\"#!/api/JW.ObservableSet\" rel=\"JW.ObservableSet\" class=\"docClass\">JW.ObservableSet</a><span class=\"signature\"></span></div><div class='description'><div class='short'> ...</div><div class='long'>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>items</span> : Array (optional)<div class='sub-desc'><p><code>&lt;T&gt;</code> Initial contents. By default, created collection is empty.</p>\n</div></li><li><span class='pre'>adapter</span> : boolean (optional)<div class='sub-desc'><p>Create set as adapter of <code>items</code> (<code>items</code> should be Object for this, not Array).\nDefaults to false, so <code>items</code> is copied.</p>\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'><a href=\"#!/api/JW.ObservableSet\" rel=\"JW.ObservableSet\" class=\"docClass\">JW.ObservableSet</a></span><div class='sub-desc'>\n</div></li></ul></div></div></div><div id='method-S-addAll' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/JW.AbstractSet' rel='JW.AbstractSet' class='defined-in docClass'>JW.AbstractSet</a><br/><a href='source/abstractSet.html#JW-AbstractSet-method-S-addAll' target='_blank' class='view-source'>view source</a></div><a href='#!/api/JW.AbstractSet-method-S-addAll' class='name expandable'>$addAll</a>( <span class='pre'>items</span> ) : <a href=\"#!/api/JW.Array\" rel=\"JW.Array\" class=\"docClass\">JW.Array</a><span class=\"signature\"></span></div><div class='description'><div class='short'>Adds multiple items to set, ones that are absent. ...</div><div class='long'><p>Adds multiple items to set, ones that are absent.</p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>items</span> : Array<div class='sub-desc'><p><code>&lt;T&gt;</code> Items.</p>\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'><a href=\"#!/api/JW.Array\" rel=\"JW.Array\" class=\"docClass\">JW.Array</a></span><div class='sub-desc'><p><code>&lt;T&gt;</code> Added items.</p>\n</div></li></ul></div></div></div><div id='method-S-asArray' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/JW.AbstractCollection' rel='JW.AbstractCollection' class='defined-in docClass'>JW.AbstractCollection</a><br/><a href='source/abstractCollection.html#JW-AbstractCollection-method-S-asArray' target='_blank' class='view-source'>view source</a></div><a href='#!/api/JW.AbstractCollection-method-S-asArray' class='name expandable'>$asArray</a>( <span class='pre'></span> ) : <a href=\"#!/api/JW.Array\" rel=\"JW.Array\" class=\"docClass\">JW.Array</a><span class=\"signature\"></span></div><div class='description'><div class='short'>Represents collection as array. ...</div><div class='long'><p>Represents collection as array.</p>\n\n<p>If this collection is array, returns it immediately. Else, executes <a href=\"#!/api/JW.AbstractCollection-method-toArray\" rel=\"JW.AbstractCollection-method-toArray\" class=\"docClass\">toArray</a> method.\nThis method works probably faster than <a href=\"#!/api/JW.AbstractCollection-method-toArray\" rel=\"JW.AbstractCollection-method-toArray\" class=\"docClass\">toArray</a>, but please make sure that the returned array\nwon't be modified externally, because it can cause strange unexpected bugs.</p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'><a href=\"#!/api/JW.Array\" rel=\"JW.Array\" class=\"docClass\">JW.Array</a></span><div class='sub-desc'><p><code>&lt;T&gt;</code> Items array</p>\n</div></li></ul></div></div></div><div id='method-S-asSet' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/JW.AbstractCollection' rel='JW.AbstractCollection' class='defined-in docClass'>JW.AbstractCollection</a><br/><a href='source/abstractCollection.html#JW-AbstractCollection-method-S-asSet' target='_blank' class='view-source'>view source</a></div><a href='#!/api/JW.AbstractCollection-method-S-asSet' class='name expandable'>$asSet</a>( <span class='pre'></span> ) : <a href=\"#!/api/JW.Set\" rel=\"JW.Set\" class=\"docClass\">JW.Set</a><span class=\"signature\"></span></div><div class='description'><div class='short'>Represents collection as set. ...</div><div class='long'><p>Represents collection as set.</p>\n\n<p>If this collection is set, returns it immediately. Else, executes <a href=\"#!/api/JW.AbstractCollection-method-toSet\" rel=\"JW.AbstractCollection-method-toSet\" class=\"docClass\">toSet</a> method.\nThis method works probably faster than <a href=\"#!/api/JW.AbstractCollection-method-toSet\" rel=\"JW.AbstractCollection-method-toSet\" class=\"docClass\">toSet</a>, but please make sure that the returned set\nwon't be modified externally, because it can cause strange unexpected bugs.</p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'><a href=\"#!/api/JW.Set\" rel=\"JW.Set\" class=\"docClass\">JW.Set</a></span><div class='sub-desc'><p><code>&lt;T&gt;</code> Items set.</p>\n</div></li></ul></div></div></div><div id='method-S-clear' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/JW.AbstractSet' rel='JW.AbstractSet' class='defined-in docClass'>JW.AbstractSet</a><br/><a href='source/abstractSet.html#JW-AbstractSet-method-S-clear' target='_blank' class='view-source'>view source</a></div><a href='#!/api/JW.AbstractSet-method-S-clear' class='name expandable'>$clear</a>( <span class='pre'></span> ) : <a href=\"#!/api/JW.Array\" rel=\"JW.Array\" class=\"docClass\">JW.Array</a><span class=\"signature\"></span></div><div class='description'><div class='short'>Clears collection. ...</div><div class='long'><p>Clears collection.</p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'><a href=\"#!/api/JW.Array\" rel=\"JW.Array\" class=\"docClass\">JW.Array</a></span><div class='sub-desc'><p><code>&lt;T&gt;</code> Old collection contents.</p>\n</div></li></ul><p>Overrides: <a href=\"#!/api/JW.AbstractCollection-method-S-clear\" rel=\"JW.AbstractCollection-method-S-clear\" class=\"docClass\">JW.AbstractCollection.$clear</a></p></div></div></div><div id='method-S-filter' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/JW.AbstractSet' rel='JW.AbstractSet' class='defined-in docClass'>JW.AbstractSet</a><br/><a href='source/abstractSet.html#JW-AbstractSet-method-S-filter' target='_blank' class='view-source'>view source</a></div><a href='#!/api/JW.AbstractSet-method-S-filter' class='name expandable'>$filter</a>( <span class='pre'>f, [scope]</span> ) : <a href=\"#!/api/JW.Set\" rel=\"JW.Set\" class=\"docClass\">JW.Set</a><span class=\"signature\"></span></div><div class='description'><div class='short'>Filters collection by criteria. ...</div><div class='long'><p>Filters collection by criteria.</p>\n\n<p>Builds new collection of the same type, consisting of items for which <code>f</code> returns !== <code>false</code>.</p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>f</span> : Function<div class='sub-desc'><p><code>f(item: T): boolean</code></p>\n\n<p>Criteria.</p>\n</div></li><li><span class='pre'>scope</span> : Object (optional)<div class='sub-desc'><p><code>f</code> call scope. Defaults to <code>this</code>.</p>\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'><a href=\"#!/api/JW.Set\" rel=\"JW.Set\" class=\"docClass\">JW.Set</a></span><div class='sub-desc'><p><code>&lt;T&gt;</code> Filtered collection.</p>\n</div></li></ul><p>Overrides: <a href=\"#!/api/JW.AbstractCollection-method-S-filter\" rel=\"JW.AbstractCollection-method-S-filter\" class=\"docClass\">JW.AbstractCollection.$filter</a></p></div></div></div><div id='method-S-index' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/JW.AbstractCollection' rel='JW.AbstractCollection' class='defined-in docClass'>JW.AbstractCollection</a><br/><a href='source/abstractCollection.html#JW-AbstractCollection-method-S-index' target='_blank' class='view-source'>view source</a></div><a href='#!/api/JW.AbstractCollection-method-S-index' class='name expandable'>$index</a>( <span class='pre'>f, [scope]</span> ) : <a href=\"#!/api/JW.Map\" rel=\"JW.Map\" class=\"docClass\">JW.Map</a><span class=\"signature\"></span></div><div class='description'><div class='short'>Indexes collection. ...</div><div class='long'><p>Indexes collection.</p>\n\n<p>Builds new map by rule: key is the result of indexer function call, value is the corresponding item.</p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>f</span> : Function<div class='sub-desc'><p><code>f(item: T): string</code></p>\n\n<p>Indexer function.</p>\n</div></li><li><span class='pre'>scope</span> : Object (optional)<div class='sub-desc'><p><code>f</code> call scope. Defaults to <code>this</code>.</p>\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'><a href=\"#!/api/JW.Map\" rel=\"JW.Map\" class=\"docClass\">JW.Map</a></span><div class='sub-desc'><p><code>&lt;T&gt;</code> Collection index.</p>\n</div></li></ul></div></div></div><div id='method-S-map' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/JW.AbstractSet' rel='JW.AbstractSet' class='defined-in docClass'>JW.AbstractSet</a><br/><a href='source/abstractSet.html#JW-AbstractSet-method-S-map' target='_blank' class='view-source'>view source</a></div><a href='#!/api/JW.AbstractSet-method-S-map' class='name expandable'>$map</a>( <span class='pre'>f, [scope]</span> ) : <a href=\"#!/api/JW.Set\" rel=\"JW.Set\" class=\"docClass\">JW.Set</a><span class=\"signature\"></span></div><div class='description'><div class='short'>&lt;U&gt; Maps collection items. ...</div><div class='long'><p><code>&lt;U&gt;</code> Maps collection items.</p>\n\n<p>Builds new collection of the same type, consisting of results of <code>f</code> call for each collection item.</p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>f</span> : Function<div class='sub-desc'><p><code>f(item: T): U</code></p>\n\n<p>Mapping function.</p>\n</div></li><li><span class='pre'>scope</span> : Object (optional)<div class='sub-desc'><p><code>f</code> call scope. Defaults to <code>this</code>.</p>\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'><a href=\"#!/api/JW.Set\" rel=\"JW.Set\" class=\"docClass\">JW.Set</a></span><div class='sub-desc'><p><code>&lt;U&gt;</code> Mapped collection.</p>\n</div></li></ul><p>Overrides: <a href=\"#!/api/JW.AbstractCollection-method-S-map\" rel=\"JW.AbstractCollection-method-S-map\" class=\"docClass\">JW.AbstractCollection.$map</a></p></div></div></div><div id='method-S-removeAll' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/JW.AbstractSet' rel='JW.AbstractSet' class='defined-in docClass'>JW.AbstractSet</a><br/><a href='source/abstractSet.html#JW-AbstractSet-method-S-removeAll' target='_blank' class='view-source'>view source</a></div><a href='#!/api/JW.AbstractSet-method-S-removeAll' class='name expandable'>$removeAll</a>( <span class='pre'>items</span> ) : <a href=\"#!/api/JW.Array\" rel=\"JW.Array\" class=\"docClass\">JW.Array</a><span class=\"signature\"></span></div><div class='description'><div class='short'>Removes multiple items from set, ones that are present. ...</div><div class='long'><p>Removes multiple items from set, ones that are present.</p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>items</span> : Array<div class='sub-desc'><p><code>&lt;T&gt;</code> Items.</p>\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'><a href=\"#!/api/JW.Array\" rel=\"JW.Array\" class=\"docClass\">JW.Array</a></span><div class='sub-desc'><p><code>&lt;T&gt;</code> Removed items.</p>\n</div></li></ul></div></div></div><div id='method-S-toArray' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/JW.AbstractCollection' rel='JW.AbstractCollection' class='defined-in docClass'>JW.AbstractCollection</a><br/><a href='source/abstractCollection.html#JW-AbstractCollection-method-S-toArray' target='_blank' class='view-source'>view source</a></div><a href='#!/api/JW.AbstractCollection-method-S-toArray' class='name expandable'>$toArray</a>( <span class='pre'></span> ) : <a href=\"#!/api/JW.Array\" rel=\"JW.Array\" class=\"docClass\">JW.Array</a><span class=\"signature\"></span></div><div class='description'><div class='short'>Converts collection to array. ...</div><div class='long'><p>Converts collection to array.</p>\n\n<p>Builds new array consisting of collection items.</p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'><a href=\"#!/api/JW.Array\" rel=\"JW.Array\" class=\"docClass\">JW.Array</a></span><div class='sub-desc'><p><code>&lt;T&gt;</code> Items array.</p>\n</div></li></ul></div></div></div><div id='method-S-toSet' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/JW.AbstractCollection' rel='JW.AbstractCollection' class='defined-in docClass'>JW.AbstractCollection</a><br/><a href='source/abstractCollection.html#JW-AbstractCollection-method-S-toSet' target='_blank' class='view-source'>view source</a></div><a href='#!/api/JW.AbstractCollection-method-S-toSet' class='name expandable'>$toSet</a>( <span class='pre'></span> ) : <a href=\"#!/api/JW.Set\" rel=\"JW.Set\" class=\"docClass\">JW.Set</a><span class=\"signature\"></span></div><div class='description'><div class='short'>Converts collection to set. ...</div><div class='long'><p>Converts collection to set.</p>\n\n<p>Builds new set consisting of collection items.</p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'><a href=\"#!/api/JW.Set\" rel=\"JW.Set\" class=\"docClass\">JW.Set</a></span><div class='sub-desc'><p><code>&lt;T&gt;</code> Items set.</p>\n</div></li></ul></div></div></div><div id='method-S-toSorted' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/JW.AbstractCollection' rel='JW.AbstractCollection' class='defined-in docClass'>JW.AbstractCollection</a><br/><a href='source/abstractCollection.html#JW-AbstractCollection-method-S-toSorted' target='_blank' class='view-source'>view source</a></div><a href='#!/api/JW.AbstractCollection-method-S-toSorted' class='name expandable'>$toSorted</a>( <span class='pre'>[f], [scope], [order]</span> ) : <a href=\"#!/api/JW.Array\" rel=\"JW.Array\" class=\"docClass\">JW.Array</a><span class=\"signature\"></span></div><div class='description'><div class='short'>Converts collection to sorted array. ...</div><div class='long'><p>Converts collection to sorted array.</p>\n\n<p>Builds array consisting of collection items sorted by result of <code>f</code> call for each item.</p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>f</span> : Function (optional)<div class='sub-desc'><p><code>f(item: T): number/string</code></p>\n\n<p>Indexer function. Returns <code>item</code> by default.</p>\n</div></li><li><span class='pre'>scope</span> : Object (optional)<div class='sub-desc'><p><code>f</code> call scope. Defaults to <code>this</code>.</p>\n</div></li><li><span class='pre'>order</span> : 1/-1 (optional)<div class='sub-desc'><p>Sorting order.</p>\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'><a href=\"#!/api/JW.Array\" rel=\"JW.Array\" class=\"docClass\">JW.Array</a></span><div class='sub-desc'><p><code>&lt;T&gt;</code> Sorted array.</p>\n</div></li></ul></div></div></div><div id='method-S-toSortedComparing' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/JW.AbstractCollection' rel='JW.AbstractCollection' class='defined-in docClass'>JW.AbstractCollection</a><br/><a href='source/abstractCollection.html#JW-AbstractCollection-method-S-toSortedComparing' target='_blank' class='view-source'>view source</a></div><a href='#!/api/JW.AbstractCollection-method-S-toSortedComparing' class='name expandable'>$toSortedComparing</a>( <span class='pre'>[compare], [scope], [order]</span> ) : <a href=\"#!/api/JW.Array\" rel=\"JW.Array\" class=\"docClass\">JW.Array</a><span class=\"signature\"></span></div><div class='description'><div class='short'>Converts collection to sorted array. ...</div><div class='long'><p>Converts collection to sorted array.</p>\n\n<p>Builds array consisting of collection items sorted by comparer.</p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>compare</span> : Function (optional)<div class='sub-desc'><p><code>f(t1: T, t2: T): number</code></p>\n\n<p>Comparer function. Returns positive value if t1 > t2; nagative value if t1 &lt; t2; 0 if t1 == t2.\nDefaults to <code><a href=\"#!/api/JW-static-method-cmp\" rel=\"JW-static-method-cmp\" class=\"docClass\">JW.cmp</a>(t1, t2)</code>.</p>\n</div></li><li><span class='pre'>scope</span> : Object (optional)<div class='sub-desc'><p><code>f</code> call scope. Defaults to <code>this</code>.</p>\n</div></li><li><span class='pre'>order</span> : 1/-1 (optional)<div class='sub-desc'><p>Sorting order.</p>\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'><a href=\"#!/api/JW.Array\" rel=\"JW.Array\" class=\"docClass\">JW.Array</a></span><div class='sub-desc'><p><code>&lt;T&gt;</code> Sorted array.</p>\n</div></li></ul></div></div></div><div id='method-_super' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/JW.Class' rel='JW.Class' class='defined-in docClass'>JW.Class</a><br/><a href='source/class.html#JW-Class-method-_super' target='_blank' class='view-source'>view source</a></div><a href='#!/api/JW.Class-method-_super' class='name expandable'>_super</a>( <span class='pre'></span> ) : Mixed<span class=\"signature\"></span></div><div class='description'><div class='short'>This method is available only inside class methods that were passed into JW.extend method. ...</div><div class='long'><p>This method is available only inside class methods that were passed into <a href=\"#!/api/JW-static-method-extend\" rel=\"JW-static-method-extend\" class=\"docClass\">JW.extend</a> method.\nThis method is an easy way of the same superclass method calling:</p>\n\n<pre><code>...\n// Class method\nmyMethod: function(a, b, c) {\n    return this.<a href=\"#!/api/JW.Class-method-_super\" rel=\"JW.Class-method-_super\" class=\"docClass\">_super</a>(a, b) + c;\n}\n...\n</code></pre>\n\n<p>Equivalent code without <a href=\"#!/api/JW.Class-method-_super\" rel=\"JW.Class-method-_super\" class=\"docClass\">_super</a> usage:</p>\n\n<pre><code>...\n// Class method\nmyMethod: function(a, b, c) {\n    return MyClass.<a href=\"#!/api/JW.Class-static-property-superclass\" rel=\"JW.Class-static-property-superclass\" class=\"docClass\">superclass</a>.myMethod.call(this, a, b) + c;\n}\n...\n</code></pre>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>Mixed</span><div class='sub-desc'>\n</div></li></ul></div></div></div><div id='method-add' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/JW.AbstractSet' rel='JW.AbstractSet' class='defined-in docClass'>JW.AbstractSet</a><br/><a href='source/abstractSet.html#JW-AbstractSet-method-add' target='_blank' class='view-source'>view source</a></div><a href='#!/api/JW.AbstractSet-method-add' class='name expandable'>add</a>( <span class='pre'>item</span> ) : boolean<span class=\"signature\"></span></div><div class='description'><div class='short'>Adds item to set if one is absent. ...</div><div class='long'><p>Adds item to set if one is absent.</p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>item</span> : T<div class='sub-desc'><p>Item.</p>\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>boolean</span><div class='sub-desc'><p>Item is added successfully.</p>\n</div></li></ul></div></div></div><div id='method-addAll' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/JW.AbstractSet' rel='JW.AbstractSet' class='defined-in docClass'>JW.AbstractSet</a><br/><a href='source/abstractSet.html#JW-AbstractSet-method-addAll' target='_blank' class='view-source'>view source</a></div><a href='#!/api/JW.AbstractSet-method-addAll' class='name expandable'>addAll</a>( <span class='pre'>items</span> ) : Array<span class=\"signature\"></span></div><div class='description'><div class='short'>Adds multiple items to set, ones that are absent. ...</div><div class='long'><p>Adds multiple items to set, ones that are absent.</p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>items</span> : Array<div class='sub-desc'><p><code>&lt;T&gt;</code> Items.</p>\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>Array</span><div class='sub-desc'><p><code>&lt;T&gt;</code> Added items.</p>\n</div></li></ul></div></div></div><div id='method-asArray' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/JW.AbstractCollection' rel='JW.AbstractCollection' class='defined-in docClass'>JW.AbstractCollection</a><br/><a href='source/abstractCollection.html#JW-AbstractCollection-method-asArray' target='_blank' class='view-source'>view source</a></div><a href='#!/api/JW.AbstractCollection-method-asArray' class='name expandable'>asArray</a>( <span class='pre'></span> ) : Array<span class=\"signature\"></span></div><div class='description'><div class='short'>Represents collection as array. ...</div><div class='long'><p>Represents collection as array.</p>\n\n<p>If this collection is array, returns it immediately. Else, executes <a href=\"#!/api/JW.AbstractCollection-method-toArray\" rel=\"JW.AbstractCollection-method-toArray\" class=\"docClass\">toArray</a> method.\nThis method works probably faster than <a href=\"#!/api/JW.AbstractCollection-method-toArray\" rel=\"JW.AbstractCollection-method-toArray\" class=\"docClass\">toArray</a>, but please make sure that the returned array\nwon't be modified externally, because it can cause strange unexpected bugs.</p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>Array</span><div class='sub-desc'><p><code>&lt;T&gt;</code> Items array.</p>\n</div></li></ul></div></div></div><div id='method-asSet' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/JW.AbstractCollection' rel='JW.AbstractCollection' class='defined-in docClass'>JW.AbstractCollection</a><br/><a href='source/abstractCollection.html#JW-AbstractCollection-method-asSet' target='_blank' class='view-source'>view source</a></div><a href='#!/api/JW.AbstractCollection-method-asSet' class='name expandable'>asSet</a>( <span class='pre'></span> ) : Object<span class=\"signature\"></span></div><div class='description'><div class='short'>Represents collection as set. ...</div><div class='long'><p>Represents collection as set.</p>\n\n<p>If this collection is set, returns it immediately. Else, executes <a href=\"#!/api/JW.AbstractCollection-method-toSet\" rel=\"JW.AbstractCollection-method-toSet\" class=\"docClass\">toSet</a> method.\nThis method works probably faster than <a href=\"#!/api/JW.AbstractCollection-method-toSet\" rel=\"JW.AbstractCollection-method-toSet\" class=\"docClass\">toSet</a>, but please make sure that the returned set\nwon't be modified externally, because it can cause strange unexpected bugs.</p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object</span><div class='sub-desc'><p><code>&lt;T&gt;</code> Items set.</p>\n</div></li></ul></div></div></div><div id='method-clear' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/JW.AbstractSet' rel='JW.AbstractSet' class='defined-in docClass'>JW.AbstractSet</a><br/><a href='source/abstractSet.html#JW-AbstractSet-method-clear' target='_blank' class='view-source'>view source</a></div><a href='#!/api/JW.AbstractSet-method-clear' class='name expandable'>clear</a>( <span class='pre'></span> ) : Array<span class=\"signature\"></span></div><div class='description'><div class='short'>Clears collection. ...</div><div class='long'><p>Clears collection.</p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>Array</span><div class='sub-desc'><p><code>&lt;T&gt;</code> Old collection contents.</p>\n</div></li></ul><p>Overrides: <a href=\"#!/api/JW.AbstractCollection-method-clear\" rel=\"JW.AbstractCollection-method-clear\" class=\"docClass\">JW.AbstractCollection.clear</a></p></div></div></div><div id='method-contains' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/JW.AbstractSet' rel='JW.AbstractSet' class='defined-in docClass'>JW.AbstractSet</a><br/><a href='source/abstractSet.html#JW-AbstractSet-method-contains' target='_blank' class='view-source'>view source</a></div><a href='#!/api/JW.AbstractSet-method-contains' class='name expandable'>contains</a>( <span class='pre'>item</span> ) : boolean<span class=\"signature\"></span></div><div class='description'><div class='short'>Checks item existance in collection. ...</div><div class='long'><p>Checks item existance in collection. Shortcut for <a href=\"#!/api/JW.AbstractSet-method-containsItem\" rel=\"JW.AbstractSet-method-containsItem\" class=\"docClass\">containsItem</a>.</p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>item</span> : T<div class='sub-desc'><p>Item.</p>\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>boolean</span><div class='sub-desc'><p>Collection contains specified item.</p>\n</div></li></ul></div></div></div><div id='method-containsItem' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/JW.AbstractCollection' rel='JW.AbstractCollection' class='defined-in docClass'>JW.AbstractCollection</a><br/><a href='source/abstractCollection.html#JW-AbstractCollection-method-containsItem' target='_blank' class='view-source'>view source</a></div><a href='#!/api/JW.AbstractCollection-method-containsItem' class='name expandable'>containsItem</a>( <span class='pre'>item</span> ) : boolean<span class=\"signature\"></span></div><div class='description'><div class='short'>Checks item existance in collection. ...</div><div class='long'><p>Checks item existance in collection.</p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>item</span> : T<div class='sub-desc'><p>Item.</p>\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>boolean</span><div class='sub-desc'><p>Collection contains specified item.</p>\n</div></li></ul></div></div></div><div id='method-count' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/JW.AbstractCollection' rel='JW.AbstractCollection' class='defined-in docClass'>JW.AbstractCollection</a><br/><a href='source/abstractCollection.html#JW-AbstractCollection-method-count' target='_blank' class='view-source'>view source</a></div><a href='#!/api/JW.AbstractCollection-method-count' class='name expandable'>count</a>( <span class='pre'>f, [scope]</span> ) : number<span class=\"signature\"></span></div><div class='description'><div class='short'>Counts the items matching criteria. ...</div><div class='long'><p>Counts the items matching criteria.</p>\n\n<p>Returns the number of items for which <code>f</code> returns !== <code>false</code>.</p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>f</span> : Function<div class='sub-desc'><p><code>f(item: T): boolean</code></p>\n\n<p>Criteria.</p>\n</div></li><li><span class='pre'>scope</span> : Object (optional)<div class='sub-desc'><p><code>f</code> call scope. Defaults to <code>this</code>.</p>\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>number</span><div class='sub-desc'><p>Number of items.</p>\n</div></li></ul></div></div></div><div id='method-createCounter' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='JW.ObservableSet'>JW.ObservableSet</span><br/><a href='source/observableSet.html#JW-ObservableSet-method-createCounter' target='_blank' class='view-source'>view source</a></div><a href='#!/api/JW.ObservableSet-method-createCounter' class='name expandable'>createCounter</a>( <span class='pre'>config</span> ) : <a href=\"#!/api/JW.ObservableSet.Counter\" rel=\"JW.ObservableSet.Counter\" class=\"docClass\">JW.ObservableSet.Counter</a><span class=\"signature\"></span></div><div class='description'><div class='short'>Creates matching item counter. ...</div><div class='long'><p>Creates matching item counter.\nSelects appropriate synchronizer implementation automatically.</p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>config</span> : Object<div class='sub-desc'><p>Configuration (see synchronizer's Config options).</p>\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'><a href=\"#!/api/JW.ObservableSet.Counter\" rel=\"JW.ObservableSet.Counter\" class=\"docClass\">JW.ObservableSet.Counter</a></span><div class='sub-desc'><p><code>&lt;T&gt;</code> Synchronizer.</p>\n</div></li></ul><p>Overrides: <a href=\"#!/api/JW.AbstractSet-method-createCounter\" rel=\"JW.AbstractSet-method-createCounter\" class=\"docClass\">JW.AbstractSet.createCounter</a></p></div></div></div><div id='method-createEmpty' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='JW.ObservableSet'>JW.ObservableSet</span><br/><a href='source/observableSet.html#JW-ObservableSet-method-createEmpty' target='_blank' class='view-source'>view source</a></div><a href='#!/api/JW.ObservableSet-method-createEmpty' class='name expandable'>createEmpty</a>( <span class='pre'></span> ) : <a href=\"#!/api/JW.ObservableSet\" rel=\"JW.ObservableSet\" class=\"docClass\">JW.ObservableSet</a><span class=\"signature\"></span></div><div class='description'><div class='short'>&lt;U&gt; Creates empty collection of the same type. ...</div><div class='long'><p><code>&lt;U&gt;</code> Creates empty collection of the same type.</p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'><a href=\"#!/api/JW.ObservableSet\" rel=\"JW.ObservableSet\" class=\"docClass\">JW.ObservableSet</a></span><div class='sub-desc'><p><code>&lt;U&gt;</code> Collection.</p>\n</div></li></ul><p>Overrides: <a href=\"#!/api/JW.AbstractSet-method-createEmpty\" rel=\"JW.AbstractSet-method-createEmpty\" class=\"docClass\">JW.AbstractSet.createEmpty</a></p></div></div></div><div id='method-createEmptyArray' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='JW.ObservableSet'>JW.ObservableSet</span><br